CREATE TABLE IF NOT EXISTS "django_content_type" ("id" integer NOT NULL PRIMARY KEY AUTOINCREMENT, "app_label" varchar(100) NOT NULL, "model" varchar(100) NOT NULL);
CREATE TABLE IF NOT EXISTS "auth_permission" ("id" integer NOT NULL PRIMARY KEY AUTOINCREMENT, "content_type_id" integer NOT NULL REFERENCES "django_content_type" ("id"), "codename" varchar(100) NOT NULL, "name" varchar(255) NOT NULL);
CREATE TABLE IF NOT EXISTS "auth_user" ("id" integer NOT NULL PRIMARY KEY AUTOINCREMENT, "password" varchar(128) NOT NULL, "last_login" datetime NULL, "is_superuser" bool NOT NULL, "first_name" varchar(30) NOT NULL, "last_name" varchar(30) NOT NULL, "email" varchar(254) NOT NULL, "is_staff" bool NOT NULL, "is_active" bool NOT NULL, "date_joined" datetime NOT NULL, "username" varchar(150) NOT NULL UNIQUE);
CREATE TABLE IF NOT EXISTS "django_session" ("session_key" varchar(40) NOT NULL PRIMARY KEY, "session_data" text NOT NULL, "expire_date" datetime NOT NULL);
CREATE TABLE IF NOT EXISTS "tickets_ticket" ("id" integer NOT NULL PRIMARY KEY AUTOINCREMENT, "phone_number" integer NOT NULL, "ticket_number" integer NOT NULL, "pin" integer NOT NULL, "email" varchar(254) NOT NULL, "code" varchar(6) NOT NULL, "password" varchar(40) NOT NULL);
CREATE TABLE IF NOT EXISTS "tickets_user" ("username" varchar(15) NOT NULL PRIMARY KEY, "password" varchar(40) NOT NULL);
CREATE TABLE IF NOT EXISTS "tickapp_tickettype" ("id" integer NOT NULL PRIMARY KEY AUTOINCREMENT, "amount" integer NOT NULL, "tike_type" varchar(30) NOT NULL, "event_id" integer NOT NULL REFERENCES "tickapp_show" ("id"));
CREATE TABLE IF NOT EXISTS "tickapp_show" ("id" integer NOT NULL PRIMARY KEY AUTOINCREMENT, "title" varchar(100) NOT NULL, "poster" varchar(100) NOT NULL, "video" varchar(100) NOT NULL, "Description" text NOT NULL, "date" datetime NOT NULL, "tickets_no" integer NOT NULL);
CREATE TABLE IF NOT EXISTS "tickapp_profile" ("id" integer NOT NULL PRIMARY KEY AUTOINCREMENT, "event_id" integer NOT NULL REFERENCES "tickapp_show" ("id"), "seller_id" integer NOT NULL REFERENCES "auth_user" ("id"));
CREATE TABLE IF NOT EXISTS "backsys_ticket_type" ("id" integer NOT NULL PRIMARY KEY AUTOINCREMENT, "tike_type" varchar(30) NOT NULL, "event_id" integer NOT NULL REFERENCES "backsys_event" ("id"), "amount" varchar(10) NOT NULL);
CREATE TABLE IF NOT EXISTS "tickapp_ticket" ("id" integer NOT NULL PRIMARY KEY AUTOINCREMENT, "phone_number" integer NULL, "pin" varchar(10) NOT NULL, "email" varchar(254) NOT NULL, "event_id" integer NULL REFERENCES "tickapp_show" ("id"), "Name" varchar(100) NOT NULL, "seller_id" integer NULL REFERENCES "tickapp_profile" ("id"), "ticket_type_id" integer NULL REFERENCES "tickapp_tickettype" ("id"), "status" bool NOT NULL);
